import React from "react";

function NewLogin() {
  return (
    <form>
      <div>
        <label>E-Mail</label>
        <input type="email"></input>
      </div>
      <div>
        <label>Password</label>
        <input type="password"></input>
      </div>
      <button type="submit"></button>
    </form>
  );
}

export default NewLogin;
